import React from "react";
import styled from "styled-components";
import { TwitterOutlined } from "@ant-design/icons";
const Component = styled.div`
display: grid;
grid-template-columns: 32px 1fr;
align-items: center;
margin: 21px 0;
}
p{
    font-size: 14px;
    font-weight: 500;
}

span{
    text-align: left;
    font-size:20px;
    color:#1D99E6
}

`;
export default function UserAccounts({ name, account, accountId }) {
  return (
    <Component>
      <TwitterOutlined /> <p> {name}</p>
    </Component>
  );
}
